-- ----------------------------
DROP TABLE IF EXISTS `fy_cheng`;
CREATE TABLE `fy_cheng` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `ip` varchar(64) NOT NULL COMMENT 'ip',
  `port` int(10) NOT NULL COMMENT '端口',
  `departId` varchar(64) NOT NULL COMMENT '部门id',
  `locationX` int(10) DEFAULT '0' COMMENT 'X坐标',
  `locationY` int(10) DEFAULT '0' COMMENT 'Y坐标',
  `locationZ` int(10) DEFAULT '0' COMMENT '楼层',
  `status` varchar(8) NOT NULL DEFAULT '00' COMMENT '运行状态',
  `enable` varchar(8) NOT NULL DEFAULT '0' COMMENT '是否开',
  `type` varchar(8) DEFAULT NULL COMMENT '类型',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='业务数据表';

