-- ----------------------------
--  Table structure for `fy_garbage_list`
-- ----------------------------
DROP TABLE IF EXISTS `fy_garbage_list`;
CREATE TABLE `fy_garbage_list` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `weight` int(10) NOT NULL DEFAULT '0' COMMENT '重量，单位为克',
  `weight_choujian` int(10) DEFAULT '0' COMMENT '抽检重量',
  `choujian_flag` int(10) NOT NULL DEFAULT '0' COMMENT '是否抽检标志(0未抽检、1已抽检)',
  `shouer_id` varchar(64) NOT NULL COMMENT '垃圾收集人员id',
  `departer_id` varchar(64) NOT NULL COMMENT '部门负责人id',
  `depart_id` varchar(64) NOT NULL COMMENT '部门id',
  `type` varchar(100) NOT NULL COMMENT '垃圾类型',
  `status` varchar(255) DEFAULT NULL COMMENT '状态',
  `in_date` date NOT NULL COMMENT '加入日期',
  `wu_cha` int(10) NOT NULL DEFAULT '0' COMMENT '允许误差的范围',
  `cheng1_id` int(10) DEFAULT NULL COMMENT '称重称',
  `cheng2_id` int(10) DEFAULT NULL COMMENT '抽检称',
  `tiao_ma_uuid` varchar(255) NOT NULL COMMENT '条码编号（<=10位数）',
  `tiao_ma_info` varchar(255) DEFAULT NULL COMMENT '条码信息 不得超过20个',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='垃圾称重列表';

